import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid';

const useStyles = makeStyles({
    container: { 
      backgroundColor: '#ccf0e1', 
      height: '80vh', 
      marginTop:'10vh' 
    },
    root: {
      width: '100%'
    },
    heading:{
      color: '#084177'
    },
  });

export default function NameComponent(){
    const classes = useStyles();
    return(
        <form noValidate autoComplete="off" style={{height: "100%"}}>
                <Grid container justify="center" direction="column" alignItems="center" spacing={5}>
                  <Grid item xs={12}>
                    <h2 style={classes.heading}>Let's get your Name</h2>
                  </Grid>
                  <Grid item xs={4} style={classes.root}>
                     <TextField style={classes.root} label="First Name" variant="outlined" />
                  </Grid>
                  <Grid item xs={4} style={classes.root}>
                     <TextField style={classes.root}  label="Middle Name" variant="outlined" />
                  </Grid>
                  <Grid item xs={4} style={classes.root}>
                     <TextField style={classes.root}  label="Last Name" variant="outlined" />
                  </Grid>
                  <Grid item xs={4}>
                 </Grid>

                 <Grid item xs={4}>
                 </Grid>

                 <Grid item xs={4}>
                 </Grid>

                 <Grid item >
                    <Button variant="outlined" color="primary" size="large">
                              NEXT
                    </Button>
                 </Grid>

                </Grid>
              </form>
    );
}
